class SysTray(object):
    def __init__(self,uiName,icon,hover_text):
        self.uiName = uiName
        self.icon = icon
        self.hover_text = hover_text
        self.window_class_name = "SysTray"
        message_map = {win32gui.RegisterWindowMessage("TaskbarCreated"): self.refresh_icon,
                    win32con.WM_DESTROY: self.exit,
                    win32con.WM_USER+20 : self.notify,}
        window_class = win32gui.WNDCLASS()
        window_class.hInstance = win32gui.GetModuleHandle(None)
        window_class.lpszClassName = self.window_class_name
        window_class.style = win32con.CS_VREDRAW | win32con.CS_HREDRAW 
        window_class.hCursor = win32gui.LoadCursor(0, win32con.IDC_ARROW)
        window_class.hbrBackground = win32con.COLOR_WINDOW
        window_class.lpfnWndProc = message_map #也可以指定wndproc.
        self.classAtom = win32gui.RegisterClass(window_class)
    def build(self):
        hinst = win32gui.GetModuleHandle(None)
        style = win32con.WS_OVERLAPPED | win32con.WS_SYSMENU
        self.hwnd = win32gui.CreateWindow(self.classAtom,
                                        self.window_class_name,
                                        style,
                                        0,
                                        0,
                                        win32con.CW_USEDEFAULT,
                                        win32con.CW_USEDEFAULT,
                                        0,
                                        0,
                                        hinst,
                                        None)
        win32gui.UpdateWindow(self.hwnd)
        self.notify_id = None
        self.refresh_icon()
        win32gui.PumpMessages()
    def exit(self):
        nid = (self.hwnd, 0)
        win32gui.Shell_NotifyIcon(win32gui.NIM_DELETE, nid)
        win32gui.PostQuitMessage(0) 
    def notify(self, hwnd, msg, wparam, lparam):
        if lparam == win32con.WM_RBUTTONUP:
            self.show_menu()
        elif lparam == win32con.WM_LBUTTONUP:
            self._handle = win32gui.FindWindow(None, 'StellarFrp-2.4.0.7')
            win32gui.SendMessage(self._handle, win32con.WM_SYSCOMMAND, win32con.SC_RESTORE, 0)
            win32gui.SetForegroundWindow(self._handle)
        return True
    def refresh_icon(self, **data):
        hinst = win32gui.GetModuleHandle(None)
        if os.path.isfile(self.icon):
            hicon = None
            iconPath,iconFile = os.path.split(self.icon)
            iconName,extension = os.path.splitext(iconFile)
            extension = extension.lower()
            if extension == '.ico':
                icon_flags = win32con.LR_LOADFROMFILE | win32con.LR_DEFAULTSIZE
                hicon = win32gui.LoadImage(hinst,
                                        self.icon,
                                        win32con.IMAGE_ICON,
                                        0,
                                        0,
                                        icon_flags)
            else:
                CreateIconFromResourceEx = windll.user32.CreateIconFromResourceEx
                size_x, size_y = 32, 32
                LR_DEFAULTCOLOR = 0
                with open(self.icon, "rb") as f:
                    png = f.read()
                hicon = CreateIconFromResourceEx(png, len(png), 1, 0x30000, size_x, size_y, LR_DEFAULTCOLOR)
            
        else:
            hicon = win32gui.LoadIcon(0, win32con.IDI_APPLICATION)
        if self.notify_id: 
            message = win32gui.NIM_MODIFY
        else: 
            message = win32gui.NIM_ADD
        self.notify_id = (self.hwnd,
                        0,
                        win32gui.NIF_ICON | win32gui.NIF_MESSAGE | win32gui.NIF_TIP,
                        win32con.WM_USER+20,
                        hicon,
                        self.hover_text)
        win32gui.Shell_NotifyIcon(message, self.notify_id)
    def show_menu(self):
        #Create the Popup Menu
        root = Fun.GetElement(self.uiName,"root")
        SysTrayMenu = Menu(root,tearoff=0)
        SysTrayMenu.add_command(label="退出",command=lambda:StellarFrp_cmd.SysTray_Menu_退出("StellarFrp","退出"))
        Pos = win32gui.GetCursorPos()
        SysTrayMenu.post(Pos[0],Pos[1])
