class  StellarFrp:
    def __init__(self,root,isTKroot = True,params=None):
        uiName = Fun.GetUIName(root,self.__class__.__name__)
        self.uiName = uiName
        Fun.Register(uiName,'UIClass',self)
        self.root = root
        self.isTKroot = isTKroot
        self.firstRun = True
        Fun.G_UIParamsDictionary[uiName]=params
        Fun.G_UICommandDictionary[uiName]=StellarFrp_cmd
        Fun.Register(uiName,'root',root)
        style = StellarFrp_sty.SetupStyle(isTKroot)
        if isTKroot == True:
            Fun.SetTitleBar(root,titleText='StellarFrp-2.4.0.7',isDarkMode=False)
            Fun.CenterDlg(uiName,root,1440,900)
            Fun.WindowDraggable(root,False,0,'#00ffff')
            root.minsize(864, 540)
            if os.path.exists("Resources/logo.ico"):
                root.iconbitmap("Resources/logo.ico")
            root['background'] = '#F0F0F0'
        Form_1= tkinter.Canvas(root,width = 10,height = 4)
        Form_1.pack(side=tkinter.TOP,fill=tkinter.BOTH,expand=True)
        Form_1.configure(width = 1440)
        Form_1.configure(height = 900)
        Form_1.configure(bg = "#F0F0F0")
        Form_1.configure(highlightthickness = 0)
        Fun.Register(uiName,'Form_1',Form_1)
        Fun.SetUIRootSize(uiName,1440,900)
        #Create the elements of root 
        Frame_2 = tkinter.Frame(Form_1)
        Fun.Register(uiName,'PyMe_Frame_2',Frame_2,'list')
        Fun.SetControlPlace(uiName,'PyMe_Frame_2',0.0,0.0,0.1388888888888889,1.0,'nw',True,True)
        Frame_2.configure(bg = "#CCCCCC")
        Fun.SetRoundedRectangle(uiName,'list',25,25)
        list_2 = list.list(Frame_2,False)
        Fun.Register(uiName,'list_2',list_2)
        Fun.SetElementLayer(uiName,'list',direction='lower')
        Frame_3 = tkinter.Frame(Form_1)
        Fun.Register(uiName,'PyMe_Frame_3',Frame_3,'sign')
        Fun.SetControlPlace(uiName,'PyMe_Frame_3',0.0006944444444444445,0.0011111111111111111,1.0,1.0,'nw',True,True)
        Frame_3.configure(bg = "#CCCCCC")
        login_main_3 = login_main.login_main(Frame_3,False)
        Fun.Register(uiName,'login_main_3',login_main_3)
        Fun.SetElementLayer(uiName,'sign',direction='lift')
        Frame_14 = tkinter.Frame(Form_1)
        Fun.Register(uiName,'PyMe_Frame_14',Frame_14,'main')
        Fun.SetControlPlace(uiName,'PyMe_Frame_14',0.1388888888888889,0.0,0.8611111111111112,1.0,'nw',False,True)
        Frame_14.place_forget()
        Frame_14.configure(bg = "#CCCCCC")
        main_14 = main.main(Frame_14,False)
        Fun.Register(uiName,'main_14',main_14)
        Fun.SetElementLayer(uiName,'main',direction='lift')
        #Inital all element's Data 
        Fun.InitElementData(uiName)
        #Call Form_1's OnLoad Function
        Fun.RunForm1_CallBack(uiName,"Load",StellarFrp_cmd.Form_1_onLoad)
        #Add Some Logic Code Here: (Keep This Line of comments)



        #Setup SysTray: (Keep This Line of comments)
        self.SetupSysTray()
        if self.isTKroot == True and Fun.GetElement(self.uiName,"root"):
            self.root.protocol('WM_DELETE_WINDOW', self.Exit)
            self.root.bind('<Configure>', self.Configure)
            
    def SetupSysTray(self):
        t = Thread(target=self.StartSysTrayThread, args=())
        t.setDaemon(True)
        t.start()
    def StartSysTrayThread(self):
        icons = r'Resources/logo.ico'
        self.sysTray = SysTray(self.uiName,icons, "StellarFrp-2.4.0.7")
        Fun.Register(self.uiName,'SysTray',self.sysTray)
        self.sysTray.build()
    def GetRootSize(self):
        return Fun.GetUIRootSize(self.uiName)
    def GetAllElement(self):
        return Fun.G_UIElementDictionary[self.uiName]
    def Escape(self,event):
        if Fun.AskBox('提示','确定退出程序？') == True:
            self.Exit()
    def Exit(self):
        #Call Form_1's OnExit Function
        Result = Fun.RunForm1_CallBack(self.uiName,"Exit",StellarFrp_cmd.Form_1_onExit)
        if self.isTKroot == True and Result != False:
            Fun.DestroyUI(self.uiName)
            self.sysTray.exit()

    def Configure(self,event):
        Form_1 = Fun.GetElement(self.uiName,'Form_1')
        if Form_1 == event.widget:
            Fun.ReDrawCanvasRecord(self.uiName)
        if self.root == event.widget:
            Fun.ResizeRoot(self.uiName,self.root,event)
            Fun.ResizeAllChart(self.uiName)
            uiName = self.uiName
            pass
        Fun.ActiveElement(self.uiName,event.widget)
